    const [categories, setCategories] = useState([]);
    const response = data.data.


    useEffect(() => {
       CategoryService.getCategories()
           .then((data)=> setCategories(data.da))
    }, []);

    return (
        <>
            <div className='mx-auto w-[1000px] font-inter'>
            </div>
        </>
    )
}

export default EventCategories;

